/*!50003 CREATE*/ /*!50017 DEFINER=`foodwaste`@`%`*/ /*!50003 trigger trg_score AFTER UPDATE ON transactions FOR EACH ROW
BEGIN
    declare v_rating_coef float DEFAULT 0.25;
    declare v_lower_threshold int DEFAULT 10;
    declare v_upper_threshold int DEFAULT 200;
    declare v_threshold_coef float DEFAULT 0.1;
    declare v_normalized_quantity int;
    SELECT CASE 
		WHEN NEW.quantity < v_lower_threshold 
			THEN v_lower_threshold 
		WHEN NEW.quantity > v_upper_threshold 
			THEN v_upper_threshold 
		ELSE NEW.quantity 
        END 
	INTO v_normalized_quantity;
	IF NEW.rating IS NOT NULL AND NEW.state = 1 THEN
		UPDATE users SET score = score + NEW.rating * v_rating_coef * v_normalized_quantity * v_threshold_coef WHERE uid = NEW.PID;
    END IF;
END */;;
DELIMITER ;
