BEGIN
	DECLARE v_ret int;
    DECLARE v_verif int;
    SELECT tid INTO v_verif FROM transactions WHERE tid = p_tid AND cid = p_uid AND state = -1;
    IF v_verif IS NULL THEN
		RETURN -1;
	END IF;
	UPDATE transactions set state = 0 WHERE tid = p_tid AND cid = p_uid AND state = -1;
