CREATE DEFINER=`foodwaste`@`%` FUNCTION `rate_transaction`(p_uid int, p_tid int, p_rating float, p_message text) RETURNS int(11)
BEGIN
	DECLARE v_verif int;
	SELECT tid INTO v_verif FROM transactions WHERE tid = p_tid AND cid=p_uid AND state = 1;
	IF v_verif IS NULL THEN
		RETURN -1;
    END IF;
    UPDATE transactions SET rating = p_rating, message = p_message WHERE tid = p_tid AND cid = p_uid AND state = 1;
    RETURN p_tid;
END ;;
