CREATE DEFINER=`foodwaste`@`%` PROCEDURE `get_transactions`(p_uid int, p_user_type ENUM('consumer', 'provider'))
BEGIN
	
	IF p_user_type = 'consumer' THEN
		SELECT t.tid, t.state, t.quantity, DATE_FORMAT(t.start_date, '%Y %m %d') AS start_date, DATE_FORMAT(t.due_date, '%Y %m %d') AS due_date, DATE_FORMAT(t.finished_date, '%Y %m %d') AS finish_date, t.rating, t.message, u.uid, u.name
		FROM transactions t
		JOIN users u ON (u.uid = t.pid)
		WHERE cid = p_uid
		ORDER BY state, start_date, due_date;
	ELSE
		SELECT t.tid, t.state, t.quantity, DATE_FORMAT(t.start_date, '%Y %m %d') AS start_date, DATE_FORMAT(t.due_date, '%Y %m %d') AS due_date, DATE_FORMAT(t.finished_date, '%Y %m %d') AS finish_date, t.rating, t.message, u.uid, u.name
		FROM transactions t
		JOIN users u ON (u.uid = t.cid)
		WHERE pid = p_uid
		ORDER BY state, start_date, due_date;
    END IF;
END ;;
DELIMITER ;
